import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = ({objects}) => {
  
  return (
    <div>
      {
         objects.map((object)=>{
          const {name}= object;
          const description= {name, ...object};
          
            <Tile
            name= {name}
            description= {description}
          ></Tile>
          
          
        })
      }
    </div>
  );
};
